import React from "react";
import BasicLayout from "../layouts/BasicLayout";
import { Link } from "react-router-dom";

function AboutPage() {
    return(
        <BasicLayout>
            <div className={'text-3xl'}>About Page</div>
            <Link></Link>
        </BasicLayout>
    );
}

export default AboutPage;
